import { NavLink } from "react-router-dom";
import class_navbar from "./Navbar.module.css";
// import "./Navbar.css";

const Navbar = () => {
  return (
    <nav className={class_navbar.nav}>
      <div className={`${class_navbar.item} ${class_navbar.news}`}>
        <NavLink to="/dialogs" activeClassName={class_navbar}>
          Messages
        </NavLink>
      </div>
      <div className={`${class_navbar.item} ${class_navbar.feed}`}>
        <NavLink to="/profile" activeClassName={class_navbar}>
          Profile
        </NavLink>
      </div>
      <div className={`${class_navbar.item} ${class_navbar.settings}`}>
        <NavLink to="/news" activeClassName={class_navbar}>
          News
        </NavLink>
      </div>
      <div className={`${class_navbar.item} ${class_navbar.music}`}>
        <NavLink to="/music" activeClassName={class_navbar}>
          Music
        </NavLink>
      </div>
      <div className={`${class_navbar.item} ${class_navbar.music}`}>
        <NavLink to="/settings" activeClassName={class_navbar}>
          Settings
        </NavLink>
      </div>
    </nav>
  );
};

export default Navbar;
